import React from "react";
import styles from "./AddWorkerForm.module.css";
const AddWorkerForm = () => {
  return (
    <>
      <form className={styles["worker-add__form"]}>
        <div className="worker-pers__info">
          <input type="text" placeholder="Name" />
          <input type="text" placeholder="Surname" />
          <input type="radio" placeholder="Gender" />
          <label htmlFor="">Male</label>
          <input type="radio" />
          <label htmlFor="">female</label>
          <label htmlFor="">BirthDay</label>
        </div>
        <div className="worker-job__info">
          <input type="date" placeholder="Birthday" />
          <input type="number" name="" id="" placeholder="Salary" />
          <input type="text" placeholder="Department" />
        </div>
        <button>Add</button>
      </form>
    </>
  );
};
export default AddWorkerForm;
